*/

// @mui material components
import Grid from "@mui/material/Grid";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";


// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";

// Sweet Alerts page components
// import Basic from "layouts/pages/sweet-alerts/components/Basic";
// import Success from "layouts/pages/sweet-alerts/components/Success";
// import CustomHtml from "layouts/pages/sweet-alerts/components/CustomHtml";
// import GithubAvatarRequest from "layouts/pages/sweet-alerts/components/GithubAvatarRequest";
// import TitleWithText from "layouts/pages/sweet-alerts/components/TitleWithText";
// import AutoClose from "layouts/pages/sweet-alerts/components/AutoClose";
// import WithAttachedFunction from "layouts/pages/sweet-alerts/components/WithAttachedFunction";
// import WithSuccessAttachedFunction from "layouts/pages/sweet-alerts/components/WithSuccessAttachedFunction";
// import RtlLanguarge from "layouts/pages/sweet-alerts/components/RtlLanguarge";

import { Table } from 'react-bootstrap';

function SweetAlerts() {


  return (
    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox mt={3} mb={8}>

        <Grid container>
          <Grid item xs={12} md={10} lg={12} py={3}>
            <Grid item xs={15} lg={12}>
              <SuiBox mb={3}>
              <Table striped bordered hover size="sm" style={{ textAlign: "center" }}>
                <thead>
                  <tr>
                    <th style={{  padding: "15px", borderColor: 'white', width: '200px' }}>AMC Wise STP</th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/schemewisestp">cScheme Wise STP</a></th>
                    <th style={{backgroundColor: "rgb(249, 221, 171)",  padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/clientwisestp">Client Wise STP</a></th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/maturingstp">STP Maturing in 1 Month</a></th>
                    <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px", borderColor: 'white', width: '200px' }}><a href="/stp/maturingstp">STP Started In Last 1 Month</a></th>

                  </tr>
                </thead>
              </Table>
              <br/>
                <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
                  <thead>
                  <tr>
                    <th  style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>AMC Name</th>
                    <th  style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>No Of STPS</th>
                    <th  style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>STP Input</th>
                    <th  style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Average STP Size</th>
                    <th  style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Contribution</th>
                  </tr>
                  </thead>
                  <tbody>
                  <tr>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" , padding:'10ppx'}}>Total</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" ,padding:'10ppx'}}>0</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd",padding:'10ppx' }}>0</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd" ,padding:'10ppx'}}>0</td>
                    <td style={{ fontWeight: "900", backgroundColor: "#ddd",padding:'10ppx' }}>100%</td>
                  </tr>
                  </tbody>
                </Table>
              </SuiBox>
            </Grid>
          </Grid>
        </Grid>
      </SuiBox>
      {/* <Footer /> */}
    </DashboardLayout>
  );
}

export default SweetAlerts;
